import { createAction } from 'redux-actions'
import { bind } from 'redux-effects'
import {
  AGENT_GRAPH,
  GRAPH_START,
  GRAPH_END,
  GRAPH_TICK
} from 'action-types'

export const loadAgentGraph = createAction(AGENT_GRAPH)
export const graphTick = createAction(GRAPH_TICK)
export const graphStart = function () {
  return {
    type: GRAPH_START
  }
}
export const graphEnd = createAction(GRAPH_END)
